           '{"foto" : "data:image/jpeg;base64,", "nombre" : "carlos", "contrasena":"88255", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/png;base64,", "nombre" : "adonai", "contrasena":"55151", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "john", "contrasena":"5651561", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "juan", "contrasena":"651612", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/webp;base64,", "nombre" : "fausto", "contrasena":"651651", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "patricio", "contrasena":"sslls516", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "james", "contrasena":"65161", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "alberto", "contrasena":"5161dsds651", "cargo" : "Administrador", "estatus" : "Activo"}, ' +
           '{"foto" : "data:image/jpeg;base64,", "nombre" : "quetza", "contrasena":"kjklrszpj546", "cargo" : "Administrador", "estatus" : "Activo"} ' +
           ']}';
           //fin de arreglo JSON

           // Convierte el texto JSON en un objeto y lo mapea para crear un arreglo de usuarios
let users = JSON.parse(text).usuarios.map((user, index) => ({
    id: String(index + 1).padStart(4, '0'),  // Asigna un ID a cada usuario, con padding de ceros
    foto: user.foto,                         // Guarda la foto del usuario
    nombre: user.nombre,                     // Guarda el nombre del usuario
    contraseña: user.contrasena,             // Guarda la contraseña del usuario
    cargo: user.cargo,                       // Guarda el cargo del usuario
    estatus: user.estatus                    // Guarda el estatus del usuario
}));

// Define un arreglo de colores y selecciona uno aleatoriamente para el fondo (experimental)
const colors = ['#FA812F'];
const randomColor = colors[Math.floor(Math.random() * colors.length)];
document.body.style.backgroundColor = randomColor;  // Aplica el color aleatorio al fondo de la página

// Cambia el color de fondo de todos los elementos 'th' en la tabla
const thElements = document.querySelectorAll('th');
thElements.forEach(th => th.style.backgroundColor = randomColor);

// Función para renderizar la tabla de usuarios
function renderTable() {
    const tableBody = document.querySelector('#userTable tbody');
    tableBody.innerHTML = '';  // Limpia el cuerpo de la tabla

    // Agrega una fila por cada usuario en el arreglo
    users.forEach(user => {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td>${user.id}</td>
            <td><img src="${user.foto}" alt="Foto de ${user.nombre}" width="50"></td>
            <td>${user.nombre}</td>
            <td>${user.contraseña}</td>
            <td>${user.cargo}</td>
            <td>${user.estatus}</td>
            <td>
                <button class="icon-button" onclick="editUser('${user.id}')"><img src="https://img.icons8.com/ios-filled/50/000000/edit.png" alt="Editar"></button>
                <button class="icon-button" onclick="confirmDeleteUser('${user.id}')"><img src="https://img.icons8.com/ios-filled/50/000000/trash.png" alt="Eliminar"></button>
            </td>
        `;
        tableBody.appendChild(row);  // Agrega la fila a la tabla
    });

    // Llama a la función para mostrar los usuarios en la consola
    logUsersToConsole();
}

// Función para abrir el formulario de usuario
function openUserForm(user = {}) {
    Swal.fire({
        title: user.id ? 'Editar Usuario' : 'Agregar Usuario',  // Título del formulario
        html: `
            <input type="hidden" id="userId" value="${user.id || ''}">
            <label for="foto">Foto:</label>
            <input type="file" id="foto" class="swal2-file" accept="image/*">
            ${user.foto ? `<img src="${user.foto}" id="previewFoto" alt="Foto de ${user.nombre}" width="50"><br>` : ''}
            <label for="nombre">Nombre:</label>
            <input type="text" id="nombre" class="swal2-input" value="${user.nombre || ''}">
            <label for="contraseña">Contraseña:</label>
            <input type="password" id="contraseña" class="swal2-input" value="${user.contraseña || ''}">
            <label for="cargo">Cargo:</label>
            <input type="text" id="cargo" class="swal2-input" value="${user.cargo || ''}">
        `,
        focusConfirm: false,
        confirmButtonText: 'Guardar',  // Texto del botón de confirmación
        preConfirm: () => {
            if (!document.getElementById('nombre').value || !document.getElementById('contraseña').value || !document.getElementById('cargo').value) {
                Swal.showValidationMessage('Por favor complete todos los campos');
                return false;
            }

            return new Promise((resolve) => {
                const fotoInput = document.getElementById('foto');
                if (fotoInput.files[0]) {
                    const reader = new FileReader();
                    reader.onload = (e) => {
                        resolve({
                            id: document.getElementById('userId').value,
                            foto: e.target.result,
                            nombre: document.getElementById('nombre').value,
                            contraseña: document.getElementById('contraseña').value,
                            cargo: document.getElementById('cargo').value,
                        });
                    };
                    reader.readAsDataURL(fotoInput.files[0]);
                } else {
                    resolve({
                        id: document.getElementById('userId').value,
                        foto: user.foto,
                        nombre: document.getElementById('nombre').value,
                        contraseña: document.getElementById('contraseña').value,
                        cargo: document.getElementById('cargo').value,
                    });
                }
            });
        }
    }).then(result => {
        if (result.isConfirmed) {
            const { id, foto, nombre, contraseña, cargo } = result.value;
            if (id) {
                const userIndex = users.findIndex(user => user.id === id);
                users[userIndex] = { id, foto, nombre, contraseña, cargo, estatus: 'Activo' };
            } else {
                const newId = String(users.length ? Math.max(...users.map(user => parseInt(user.id))) + 1 : 1).padStart(4, '0');
                users.push({ id: newId, foto, nombre, contraseña, cargo, estatus: 'Activo' });
            }
            renderTable();  // Renderiza la tabla después de agregar o editar un usuario
        }
    });

    const fotoInput = document.getElementById('foto');
    fotoInput.addEventListener('change', () => {
        const previewFoto = document.getElementById('previewFoto');
        if (fotoInput.files && fotoInput.files[0]) {
            const reader = new FileReader();
            reader.onload = (e) => {
                if (previewFoto) {
                    previewFoto.src = e.target.result;  // Muestra la previsualización de la imagen cargada
                } else {
                    const img = document.createElement('img');
                    img.id = 'previewFoto';
                    img.src = e.target.result;
                    img.width = 50;
                    fotoInput.insertAdjacentElement('afterend', img);
                }
            };
            reader.readAsDataURL(fotoInput.files[0]);
        }
    });
}

// Función para editar un usuario existente
function editUser(id) {
    const user = users.find(user => user.id === id);
    openUserForm(user);  // Abre el formulario con los datos del usuario seleccionado
}

// Función para confirmar la eliminación de un usuario
function confirmDeleteUser(id) {
    Swal.fire({
        title: '¿Estás seguro?',
        text: "No podrás revertir esto",
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Sí, eliminar',
        cancelButtonText: 'Cancelar'
    }).then((result) => {
        if (result.isConfirmed) {
            deleteUser(id);  // Elimina el usuario si se confirma la acción
            Swal.fire(
                'Eliminado!',
                'El usuario ha sido eliminado.',
                'success'
            );
        }
    });
}

// Función para eliminar un usuario (marca su estatus como "Inactivo")
function deleteUser(id) {
    const userIndex = users.findIndex(user => user.id === id);
    if (userIndex !== -1) {
        users[userIndex].estatus = 'Inactivo';
        renderTable();  // Vuelve a renderizar la tabla para reflejar los cambios
    }
}

// Función para buscar en la tabla de usuarios
function searchTable() {
    const input = document.getElementById('searchInput');
    const filter = input.value.toLowerCase();
    const table = document.getElementById('userTable');
    const tr = table.getElementsByTagName('tr');

    // Filtra las filas de la tabla según la búsqueda
    for (let i = 1; i < tr.length; i++) {
        tr[i].style.display = 'none';
        const td = tr[i].getElementsByTagName('td');
        for (let j = 1; j < td.length; j++) { // Empezamos en 1 para excluir la columna de foto
            if (td[j]) {
                if (td[j].innerHTML.toLowerCase().indexOf(filter) > -1) {
                    tr[i].style.display = '';
                    break;
                }
            }
        }
    }
}

// Función para mostrar los usuarios en la consola
function logUsersToConsole() {
    console.log("Usuarios:", users);
}

// Llamar a la función para mostrar los objetos en la consola cuando se cargue la página
renderTable();

